import React from 'react'
import { BrowserRouter as Router,Route} from 'react-router'
import { Header, Icon, Image, Menu, Segment, Sidebar } from 'semantic-ui-react'
import LandlordProfile from './LandlordProfile';
import FeedBack from './FeedBack';
import LandlordAccountReview from './LandlordAccountReview';
import ContractForm from './ContractForm';

function SidebarExampleTransitions() {

  const [activeItem, setActiveItem] = useState({
    name: 'listing'
  })

  const handleItemClick = (e, { name }) => {
    setActiveItem(name)
  }
  return (
    <div>
      <Sidebar.Pushable as={Segment}>
        <Sidebar
          as={Menu}
          icon='labeled'
          inverted
          vertical
          visible
          width='thin'
        >
           <Menu color='teal' vertical secondary fluid>

<Menu.Item
  active={activeItem === 'listing'}
  onClick={handleItemClick}
  as={Link}
  to={'/managelisting'}
>
  Manage Listing
</Menu.Item>
<Menu.Item
  color='red'
  active={activeItem === 'profile'}
  onClick={handleItemClick}
  as={Link}
  to={'/profile'}
>
  My Account
</Menu.Item>
<Menu.Item
  name='contractdetail'
  active={activeItem === 'contractdetail'}
  onClick={handleItemClick}
  as={Link}
  to={'/reviewcontract'}
>
  Review Contract
</Menu.Item>
<Menu.Item
  name='feedback'
  active={activeItem === 'feedback'}
  onClick={handleItemClick}
  as={Link}
  to={'/feedback'}
>
  FeedBack
</Menu.Item>
</Menu>
        </Sidebar>

        <Sidebar.Pusher>
          <Segment basic>
            <Router>
            <Route path="/managelisting"><LandlordProfile /></Route>
            <Route path="/feedback"><FeedBack /></Route>
            <Route path="/profile"><LandlordAccountReview /></Route>
            <Route path="/reviewcontract"><ContractForm /></Route>
            </Router>
          </Segment>
        </Sidebar.Pusher>
      </Sidebar.Pushable>
    </div>
  )
}

export default SidebarExampleTransitions
